import React from "react";
import { Link } from "react-router-dom";
import '../styles/pages-style/index-style.css';
import Header from "../Components/Header";
import Banner from "../Components/Banner";
import ContainerCards from "../Components/ContainerCards";
import Footer from "../Components/Footer";
import data from "../data.json"
import background from "../assets/backgroungAccueil.png";
import "../styles/components-style/Cards.css";

function Home() {
    return ( 
        <div className='App'>
                  <Header />
                  <Banner className="bannerHome">
                  <img className="background" src={background} alt="kasa-location-appartements" />
        <h1 className="slogan">Chez vous, partout et ailleurs</h1> 
                  </Banner> 
                  <ul className="listCards">
                      <Link className="elementCard" key={id} to={`/AccomodationSheet/${id}`}>
                  {data.logements.map(({ id, cover, title }) => (
                  <ContainerCards
                        id={id}
						cover={cover}
						title={title}
                  />
                  ))}
                  </Link>
                  </ul>
                  <Footer/>
        </div>
    )
}

export default Home;
